user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.2.1x1", "{\"row\":\"1\",\"column\":\"1\",\"name\":\"Cash\",\"label\":\"Cash\",\"desc\":\"This function registers a cash payment. The parameter field may contain up to 3 optional, comma-separated arguments. The first argument is a preset tender amount, the second argument is the 'finalize' flag, and the third and last argument is the 'groupable' flag. If the preset amount is set to '0', the user is required to enter a tender amount. If no preset is programmed, the tender amount is read from the input line. If the input line is also blank, a quick cash payment is registered. The 'finalize' flag controls whether this function finalizes the order when the tender amount equals or exceeds the balance due; this flag is effective only when the global 'Disable auto-finalization on payment' option is active.The 'groupable' flag should be set to '1' if this payment type/amount combination is to be tracked (non-zero preset amount must be specified).\",\"access\":\"acl_open_cash\",\"command\":\"cash\",\"controller\":\"Cart\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.2.1x2", "{\"row\":\"1\",\"column\":\"2\",\"name\":\"Currency Exchange\",\"label\":\"USD\",\"desc\":\"This function registers a currency conversion. The parameter indicates the currency code to convert from and must be filled.\",\"access\":\"acl_register_currency_exchange\",\"command\":\"currencyConvert\",\"controller\":\"Cart\",\"data\":\"USD\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.2.1x3", "{\"row\":\"1\",\"column\":\"3\",\"name\":\"Coupon\",\"label\":\"Coupon\",\"desc\":\"This function registers a coupon payment. The parameter field may contain up to 5 optional, comma-separated arguments. The first argument is the coupon sub-type, the second argument is a preset tender amount, the third argument is the 'silent' flag, the fourth argument is the 'finalize' flag, and the fifth and last argument is the 'groupable' flag. Sub-type is used for differentiate between different possible coupon types. If the preset amount is set to '0', the user is required to enter a tender amount. If no preset is programmed, the tender amount is read from the input line  If the input line is also blank, a quick coupon payment is registered. Normally the user will be prompted to confirm the payment; if the silent flag is set to '1', the confirmation screen will be skipped.The 'finalize' flag controls whether this function finalizes the order when the tender amount equals or exceeds the balance due; this flag is effective only when the global 'Disable auto-finalization on payment' option is active. The 'groupable' flag should be set to '1' if this payment type/amount combination is to be tracked (non-zero preset amount must be specified).\",\"access\":\"acl_register_coupon\",\"command\":\"coupon\",\"controller\":\"Cart\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.2.1x4", "{\"row\":\"1\",\"column\":\"4\",\"name\":\"Coupon\",\"label\":\"Store CPN 200.00~\",\"desc\":\"This function registers a coupon payment. The parameter field may contain up to 5 optional, comma-separated arguments. The first argument is the coupon sub-type, the second argument is a preset tender amount, the third argument is the 'silent' flag, the fourth argument is the 'finalize' flag, and the fifth and last argument is the 'groupable' flag. Sub-type is used for differentiate between different possible coupon types. If the preset amount is set to '0', the user is required to enter a tender amount. If no preset is programmed, the tender amount is read from the input line  If the input line is also blank, a quick coupon payment is registered. Normally the user will be prompted to confirm the payment; if the silent flag is set to '1', the confirmation screen will be skipped.The 'finalize' flag controls whether this function finalizes the order when the tender amount equals or exceeds the balance due; this flag is effective only when the global 'Disable auto-finalization on payment' option is active. The 'groupable' flag should be set to '1' if this payment type/amount combination is to be tracked (non-zero preset amount must be specified).\",\"access\":\"acl_register_coupon\",\"command\":\"coupon\",\"controller\":\"Cart\",\"data\":\"Store,200,1,,1\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.2.1x5", "{\"row\":\"1\",\"column\":\"5\",\"name\":\"Giftcard\",\"label\":\"Giftcard\",\"desc\":\"This function registers a giftcard payment. A giftcard payment is similar to a coupon payment, except that no change is given on a giftcard payment. The parameter field may contain up to 5 optional, comma-separated arguments. The first argument is the giftcard sub-type, the second argument is a preset tender amount, the third argument is the 'silent' flag, the fourth argument is the 'finalize' flag, and the fifth and last argument is the 'groupable' flag. Sub-type is used for differentiate between different possible giftcard types. If the preset amount is set to '0', the user is required to enter a tender amount. If no preset is programmed, the tender amount is read from the input line. If the input line is also blank, a quick giftcard payment is registered. Normally the user will be prompted to confirm the payment; if the silent flag is set to '1', the confirmation screen will be skipped.The 'finalize' flag controls whether this function finalizes the order when the tender amount equals or exceeds the balance due; this flag is effective only when the global 'Disable auto-finalization on payment' option is active. The 'groupable' flag should be set to '1' if this payment type/amount combination is to be tracked (non-zero preset amount must be specified).\",\"access\":\"acl_register_giftcard\",\"command\":\"giftcard\",\"controller\":\"Cart\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.2.1x6", "{\"row\":\"1\",\"column\":\"6\",\"name\":\"Giftcard\",\"label\":\"NY Giftcard 200.00~\",\"desc\":\"This function registers a giftcard payment. A giftcard payment is similar to a coupon payment, except that no change is given. The parameter field should be set to the giftcard type. A preset amount may also be defined after the giftcard type, separated by a comma. If no preset amount is programmed, the payment amount is read from the input line; if no input is present, the payment will be for the balance due. Finally, an optional third parameter,also separated by a comma, when set to 1, when set to 1, will cause the giftcard payment to be registered immediately, bypassing the confirm screen.\",\"access\":\"acl_register_giftcard\",\"command\":\"giftcard\",\"controller\":\"Cart\",\"data\":\"NY,200.00,1,,1\",\"obsolete\":false}");
