user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.1x5", "{\"row\":\"1\",\"column\":\"5\",\"name\":\"Annotate\",\"label\":\"Annotate\",\"desc\":\"This function is used to add and/or view annotations. Annotations are most often used to allow the user to enter customer data or special messages to be printed on receipts or checks. The parameter may be set to a pre-defined annotation code, in which case the user will be prompted to enter the annotation text for that annotation code. If the parameter is left blank, all annotations for the current order are listed, and the user may add, edit, or delete annotations per his/her access privileges.\",\"access\":\"acl_annotate,acl_view_annotations\",\"command\":\"AnnotateDialog\",\"controller\":\"Main\",\"data\":\"\",\"obsolete\":false}");
