user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.2x6", "{\"row\":\"2\",\"column\":\"6\",\"name\":\"Discount\",\"label\":\"-%\",\"desc\":\"This function registers a percentage-based discount. The parameter field can be used to program a preset percentage and label (separated by comma.) If no preset percentage is programmed, the discount percentage is read from the input line.\",\"access\":\"acl_register_discount\",\"command\":\"addDiscountByPercentage\",\"controller\":\"Cart\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.3x1", "{\"row\":\"3\",\"column\":\"1\",\"name\":\"Mass Discount\",\"label\":\"x-%\",\"desc\":\"This function registers a percentage-based discount to every cart item that is discountable. The parameter field can be used to program a preset percentage and label (separated by comma.) If no preset percentage is programmed, the discount percentage is read from the input line.\",\"access\":\"acl_register_mass_discount\",\"command\":\"addMassDiscountByPercentage\",\"controller\":\"Cart\",\"data\":\"10,Promo\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.3x2", "{\"row\":\"3\",\"column\":\"2\",\"name\":\"Shift Tax\",\"label\":\"Shift Tax\",\"desc\":\"This function shifts current item's tax status. The parameter field can be used to program a specific tax status. If a preset tax status is programmed, this function changes the current item to the preset tax status; otherwise, it shifts the item to the next tax status.\",\"access\":\"acl_shift_item_tax\",\"command\":\"shiftTax\",\"controller\":\"Cart\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.3x3", "{\"row\":\"3\",\"column\":\"3\",\"name\":\"Merge Stored Checks\",\"label\":\"Merge Stored Checks\",\"desc\":\"This function allows operator to merge checks by recalling previously stored check. The operator should recall a previously stored check first, then input a check number and click this funcion button, the checks will be merged automatically. If the operator does not input a check number to merge, a screen will pop-up for the selection of stored check. The parameter field must be empty.\",\"access\":\"acl_merge_check\",\"command\":\"mergeCheck\",\"controller\":\"GuestCheck\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.3x4", "{\"row\":\"3\",\"column\":\"4\",\"name\":\"Currency Exchange\",\"label\":\"USD\",\"desc\":\"This function registers a currency conversion. The parameter indicates the currency code to convert from and must be filled.\",\"access\":\"acl_register_currency_exchange\",\"command\":\"currencyConvert\",\"controller\":\"Cart\",\"data\":\"USD\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.3x5", "{\"row\":\"3\",\"column\":\"5\",\"name\":\"Store Check\",\"label\":\"Store Check\",\"desc\":\"This function stores the current check and issues the appropriate receipts/checks. The parameter field must be empty.\",\"access\":\"acl_store_check\",\"command\":\"storeCheck\",\"controller\":\"GuestCheck\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.3x6", "{\"row\":\"3\",\"column\":\"6\",\"name\":\"View Orders\",\"label\":\"View (Seq)\",\"desc\":\"This function allows the operator to quickly browse and view orders. The parameter may be used to indicate the search criteria. Valid values are 'sequence' for sequence number, 'table' for table number, and 'check' for check number. Default is 'sequence'.\",\"access\":\"acl_view_orders\",\"command\":\"viewOrders\",\"controller\":\"Main\",\"data\":\"sequence\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.4x1", "{\"row\":\"4\",\"column\":\"1\",\"name\":\"Reset Price Level\",\"label\":\"Reset Price Level\",\"desc\":\"This function resets the current price level. If the price level schedule is active, the currently scheduled level is restored. If the price level schedule is not active, or if no schedule has been defined, the price level reverts to the system/user default. No parameter is needed.\",\"access\":\"acl_revert_price_level\",\"command\":\"changeToCurrentLevel\",\"controller\":\"Pricelevel\",\"data\":\"\",\"obsolete\":false}");
