user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.4x4", "{\"row\":\"4\",\"column\":\"4\",\"name\":\"Pre-Finalize\",\"label\":\"Pre-Finalize\",\"desc\":\"This function closes the current order in order for finalization. As part of pre-finalization, the order is closed pending payment of the balance. The same set of post-finalization receipts, slips, and checks will be automatically printed. The parameter field may optional contain a destination. When destination is given, the order will be validated against it.\",\"access\":\"acl_pre_finalize\",\"command\":\"preFinalize\",\"controller\":\"Cart\",\"data\":\",a\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.4x5", "{\"row\":\"4\",\"column\":\"5\",\"name\":\"Recall Check\",\"label\":\"Recall Check\",\"desc\":\"This function recalls a prevously stored check for further action. The parameter field must be empty.\",\"access\":\"acl_recall_check\",\"command\":\"recallCheck\",\"controller\":\"GuestCheck\",\"data\":\"\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.4x6", "{\"row\":\"4\",\"column\":\"6\",\"name\":\"View Orders\",\"label\":\"View (table)\",\"desc\":\"This function allows the operator to quickly browse and view orders. The parameter may be used to indicate the search criteria. Valid values are 'sequence' for sequence number, 'table' for table number, and 'check' for check number. Default is 'sequence'.\",\"access\":\"acl_view_orders\",\"command\":\"viewOrders\",\"controller\":\"Main\",\"data\":\"table\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.5x1", "{\"row\":\"5\",\"column\":\"1\",\"name\":\"Dispatch\",\"label\":\"load test 20/5/1/1/1\",\"desc\":\"This function dispatches a command to a controller. The parameter field should be a comma-separated list of arguments, with the first argument being the command name, the second argument the data to pass to the command, and the third argument the controller handling the command.\",\"access\":\"acl_internal_access\",\"command\":\"dispatch\",\"controller\":\"Main\",\"data\":\"loadTest,20|5|1|1|1,LoadTest\",\"obsolete\":false}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.6.5x2", "{\"row\":\"5\",\"column\":\"2\",\"name\":\"New Check\",\"label\":\"New Check\",\"desc\":\"This function assigns a new check number to an order. If the operator input a number first, then click this funcion button, the new check number will be the same as operator's input. If the operator click this function button directly, a new check number will be generated automatically. Check number can not be duplicated. The parameter field must be empty.\",\"access\":\"acl_new_check\",\"command\":\"newCheck\",\"controller\":\"GuestCheck\",\"data\":\"\",\"obsolete\":false}");
