user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.7.1x1", "{\"row\":\"1\",\"column\":\"1\",\"name\":\"Credit Card\",\"label\":\"Credit Card\",\"desc\":\"This function registers a credit card payment. The parameter field may contain up to 4 optional, comma-separated arguments. The first argument is the credit card sub-type, the second argument is a preset tender amount, the third argument is the 'silent' flag, and the fourth and last argument is the 'finalize' flag. Sub-type should be set to the credit card type such as VISA, JCB, etc. If the preset amount is set to '0', the user is required to enter a tender amount. If no preset is programmed, the tender amount is read from the input line. If the input line is also blank, a quick credit card payment is registered. Normally the user will be prompted to confirm the payment; if the silent flag is set to '1', the confirmation screen will be skipped. The 'finalize' flag controls whether this function finalizes the order when the tender amount equals or exceeds the balance due; this flag is effective only when the global 'Disable auto-finalization on payment' option is active.\",\"access\":\"acl_register_credit_card\",\"command\":\"creditCard\",\"controller\":\"Cart\",\"data\":\"\",\"obsolete\":false}");
